contract FafyToken is ERC20, ERC20Burnable, Ownable {
    mapping(address => bool) private _blacklist;

    event Blacklisted(address indexed account);
    event Unblacklisted(address indexed account);

    constructor() ERC20("Fafy Token", "FAFY") {
        _mint(msg.sender, 100000000000 * 10 ** decimals());
    }

    function isBlacklisted(address account) public view returns (bool) {
        return _blacklist[account];
    }

    function blacklist(address account) public onlyOwner {
        _blacklist[account] = true;
        emit Blacklisted(account);
    }

    function unblacklist(address account) public onlyOwner {
        _blacklist[account] = false;
        emit Unblacklisted(account);
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual override {
        require(!isBlacklisted(from), "ERC20: sender blacklisted");
        require(!isBlacklisted(to), "ERC20: recipient blacklisted");
        require(!isBlacklisted(_msgSender()), "ERC20: caller blacklisted");
        super._beforeTokenTransfer(from, to, amount);
    }
}

